,p_query_type=>'SQL'
,p_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select "ID",',
'    null LINK_CLASS,',
'    apex_page.get_url(p_items => ''P6_ID'', p_values => "ID") LINK,',
'    null ICON_CLASS,',
'    null LINK_ATTR,',
'    null ICON_COLOR_CLASS,',
'    case when coalesce(:P6_ID,''0'') = "ID"',
'      then ''is-active'' ',
'      else '' ''',
'    end LIST_CLASS,',
'    (substr("MODEL", 1, 50)||( case when length("MODEL") > 50 then ''...'' else '''' end )) LIST_TITLE,',
'    (substr("MAKE", 1, 50)||( case when length("MAKE") > 50 then ''...'' else '''' end )) LIST_TEXT,',
'    null LIST_BADGE',
'from "CARS" x',
'where (:P6_SEARCH is null',
'        or upper(x."MODEL") like ''%''||upper(:P6_SEARCH)||''%''',
'        or upper(x."MAKE") like ''%''||upper(:P6_SEARCH)||''%''',
'    )',
'order by "MODEL"'))
